import axios from "axios"
import { GET_ERRORS, FETCH_CATEGORIES_SUCCESS} from "./types";

export const getCategories = () => dispatch => {
    axios
      .get("/categories")
      .then(res => {
        dispatch({
            type: FETCH_CATEGORIES_SUCCESS,
            categories: res.data
        });
      })
      .catch(err =>
        dispatch({
          type: GET_ERRORS,
          payload: err.response.data
        })
      );
  };
